import React, { useState } from 'react';
import { createClient } from '@supabase/supabase-js';

// TODO: Replace with your actual Supabase project URL and anon key
const SUPABASE_URL = 'https://pnpabkmytgxxlfhkhbdg.supabase.co';
const SUPABASE_ANON_KEY = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InBucGFia215dGd4eGxmaGtoYmRnIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NTEyNjQ3MTMsImV4cCI6MjA2Njg0MDcxM30.sv0zS35FeiPnpgmnjjkjSmsnmE9vwZMgMVEosPggz1U';
const supabase = createClient(SUPABASE_URL, SUPABASE_ANON_KEY);

function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);
  const [success, setSuccess] = useState(false);

  const handleLogin = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setSuccess(false);
    const { error } = await supabase.auth.signInWithPassword({ email, password });
    setLoading(false);
    if (error) {
      setError(error.message);
    } else {
      setSuccess(true);
    }
  };

  return (
    <div style={{
      minHeight: '100vh',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      background: 'linear-gradient(135deg, #232526 0%, #414345 100%)',
      position: 'relative',
      overflow: 'hidden',
    }}>
      {/* Animated background blobs */}
      <div style={{
        position: 'absolute',
        top: '-10%',
        left: '-10%',
        width: 400,
        height: 400,
        background: 'radial-gradient(circle at 30% 30%, #00c6ff 0%, transparent 70%)',
        filter: 'blur(80px)',
        opacity: 0.5,
        animation: 'move1 12s ease-in-out infinite alternate',
        zIndex: 0,
      }} />
      <div style={{
        position: 'absolute',
        bottom: '-10%',
        right: '-10%',
        width: 400,
        height: 400,
        background: 'radial-gradient(circle at 70% 70%, #f7971e 0%, transparent 70%)',
        filter: 'blur(80px)',
        opacity: 0.5,
        animation: 'move2 14s ease-in-out infinite alternate',
        zIndex: 0,
      }} />
      <style>{`
        @keyframes move1 {
          0% { transform: translateY(0) scale(1); }
          100% { transform: translateY(40px) scale(1.1); }
        }
        @keyframes move2 {
          0% { transform: translateY(0) scale(1); }
          100% { transform: translateY(-40px) scale(1.1); }
        }
        .login-card {
          animation: fadeInUp 1s cubic-bezier(.23,1.01,.32,1) 0.2s both;
        }
        @keyframes fadeInUp {
          0% { opacity: 0; transform: translateY(40px) scale(0.98); }
          100% { opacity: 1; transform: translateY(0) scale(1); }
        }
        .login-input:focus {
          outline: none;
          box-shadow: 0 0 0 2px #00c6ff, 0 2px 8px rgba(0,198,255,0.15);
          border-color: #00c6ff;
          transition: box-shadow 0.3s, border-color 0.3s;
        }
        .login-btn {
          transition: background 0.3s, transform 0.2s;
        }
        .login-btn:active {
          transform: scale(0.97);
        }
        .login-btn:disabled {
          background: #444;
          color: #aaa;
          cursor: not-allowed;
        }
      `}</style>
      <div className="login-card" style={{
        background: 'rgba(34, 40, 49, 0.95)',
        borderRadius: 24,
        boxShadow: '0 8px 32px 0 rgba(31, 38, 135, 0.37)',
        padding: 40,
        width: 360,
        zIndex: 1,
        position: 'relative',
        border: '1px solid rgba(255,255,255,0.08)',
        backdropFilter: 'blur(6px)',
      }}>
        <h2 style={{
          color: '#fff',
          marginBottom: 28,
          fontWeight: 700,
          letterSpacing: 1,
          fontSize: 32,
          textAlign: 'center',
          textShadow: '0 2px 8px rgba(0,198,255,0.08)'
        }}>Sign In</h2>
        <form onSubmit={handleLogin}>
          <div style={{ marginBottom: 22 }}>
            <label style={{ color: '#bbb', fontWeight: 500, fontSize: 15 }}>Email</label><br />
            <input
              className="login-input"
              type="email"
              value={email}
              onChange={e => setEmail(e.target.value)}
              required
              style={{
                width: '100%',
                padding: '12px 14px',
                borderRadius: 8,
                border: '1.5px solid #222',
                background: '#232526',
                color: '#fff',
                fontSize: 16,
                marginTop: 6,
                transition: 'box-shadow 0.3s, border-color 0.3s',
              }}
            />
          </div>
          <div style={{ marginBottom: 22 }}>
            <label style={{ color: '#bbb', fontWeight: 500, fontSize: 15 }}>Password</label><br />
            <input
              className="login-input"
              type="password"
              value={password}
              onChange={e => setPassword(e.target.value)}
              required
              style={{
                width: '100%',
                padding: '12px 14px',
                borderRadius: 8,
                border: '1.5px solid #222',
                background: '#232526',
                color: '#fff',
                fontSize: 16,
                marginTop: 6,
                transition: 'box-shadow 0.3s, border-color 0.3s',
              }}
            />
          </div>
          <button
            className="login-btn"
            type="submit"
            disabled={loading}
            style={{
              width: '100%',
              padding: '14px 0',
              borderRadius: 8,
              border: 'none',
              background: 'linear-gradient(90deg, #00c6ff 0%, #0072ff 100%)',
              color: '#fff',
              fontWeight: 700,
              fontSize: 18,
              boxShadow: '0 2px 8px rgba(0,198,255,0.12)',
              cursor: 'pointer',
              marginTop: 8,
              marginBottom: 8,
              letterSpacing: 1,
            }}
          >
            {loading ? (
              <span style={{ display: 'inline-block', verticalAlign: 'middle' }}>
                <span className="loader" style={{
                  display: 'inline-block',
                  width: 22,
                  height: 22,
                  border: '3px solid #fff',
                  borderTop: '3px solid #00c6ff',
                  borderRadius: '50%',
                  animation: 'spin 1s linear infinite',
                  marginRight: 8,
                  verticalAlign: 'middle',
                }} />
                Logging in...
              </span>
            ) : 'Login'}
          </button>
          <style>{`
            @keyframes spin {
              0% { transform: rotate(0deg); }
              100% { transform: rotate(360deg); }
            }
          `}</style>
          {error && <div style={{ color: '#ff4d4f', marginTop: 10, textAlign: 'center', fontWeight: 500, letterSpacing: 0.5, transition: 'color 0.3s' }}>{error}</div>}
          {success && <div style={{ color: '#00c6ff', marginTop: 10, textAlign: 'center', fontWeight: 500, letterSpacing: 0.5, transition: 'color 0.3s' }}>Login successful!</div>}
        </form>
      </div>
    </div>
  );
}

export default LoginPage;
